import React from 'react';

import { v4 as uuidv4 } from "uuid";
import { data } from './../data';

import ImgDisplayer from './ImgDisplayer';

const Gallery = ({ leng }) =>
    <div id="gallery">
        <h1 className="projects">Projects</h1>
        {data.projects.map(proj =>
            <ImgDisplayer
                key={uuidv4()}
                data={proj}
                leng={leng} />
        )}
    </div>


export default Gallery;
